import { mapGetters } from 'vuex'

export default {
  name: 'ChangePass',
  props: {
    form: {
      type: Object,
      default: function() {
        return {
          old_password: '',
          new_password: ''
        }
      }
    }
  },
  data() {
    return {
    }
  },
  computed: {
    ...mapGetters([
      'is_superuser'
    ])
  },
  methods: {
    submitForm() {
      this.$refs.form.validate((valid) => {
        if (valid) {
          this.$emit('submit', this.form.id, this.form)
        } else {
          return
        }
      })
    },
    cancelForm() {
      this.$emit('cancel')
    }
  }
}
